INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", 7001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 7, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", 7002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 7, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", 7003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 7, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", 10001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 10, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", 10002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 10, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", 10003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 10, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", 10004, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 10, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2030/12/17 14:59:59", 12001, 0, -416.5, 1, 0.0, "2015/12/17 15:00:00", 12, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", 13001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 13, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", 13002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 13, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", 13003, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 13, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", 13004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 13, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", 14001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 14, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", 14002, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 14, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", 14003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 14, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", 14004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 14, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", 15001, 0, -470.0, 1, 0.0, "2015/12/17 15:00:00", 15, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", 16001, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 16, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2030/12/17 14:59:59", 16002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 16, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2030/12/17 14:59:59", 16003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 16, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2030/12/17 14:59:59", 16004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 16, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2030/12/17 14:59:59", 17002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 17, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2030/12/17 14:59:59", 17004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 25, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2030/12/17 14:59:59", 17005, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 25, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2030/12/17 14:59:59", 17006, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 25, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2030/12/17 14:59:59", 17007, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 25, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2030/12/17 14:59:59", 18001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 18, 190801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2030/12/17 14:59:59", 18002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 18, 190801, 2, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2030/12/17 14:59:59", 19001, 0, -470.0, 1, 0.0, "2015/12/17 15:00:00", 19, 190801, 3, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2030/12/17 14:59:59", 19002, 0, -470.0, 1, 0.0, "2015/12/17 15:00:00", 19, 190801, 4, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2030/12/17 14:59:59", 20001, 0, -470.0, 1, 0.0, "2015/12/17 15:00:00", 20, 190801, 5, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2030/12/17 14:59:59", 20002, 0, -470.0, 1, 0.0, "2015/12/17 15:00:00", 20, 190801, 6, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2030/12/17 14:59:59", 21001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 21, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2030/12/17 14:59:59", 21002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 21, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2030/12/17 14:59:59", 21003, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 21, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2030/12/17 14:59:59", 21004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 21, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2030/12/17 14:59:59", 22001, 0, -430.0, 1, 0.0, "2015/12/17 15:00:00", 22, 190801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2030/12/17 14:59:59", 22002, 0, -430.0, 1, 0.0, "2015/12/17 15:00:00", 22, 190801, 2, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2030/12/17 14:59:59", 23001, 0, -430.0, 1, 0.0, "2015/12/17 15:00:00", 23, 190801, 3, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2030/12/17 14:59:59", 23002, 0, -430.0, 1, 0.0, "2015/12/17 15:00:00", 23, 190801, 4, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", 24001, 0, -385.0, 2, 4.08, "2019/01/31 12:00:00", 24, 109001, 1, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", 24002, 0, -385.0, 2, 5.0, "2019/01/31 12:00:00", 24, 109001, 2, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", 24003, 0, -385.0, 2, 10.11, "2019/01/31 12:00:00", 24, 109001, 3, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", 24004, 0, -385.0, 2, 4.0, "2019/01/31 12:00:00", 24, 109001, 4, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", 24005, 0, -385.0, 2, 6.0, "2019/01/31 12:00:00", 24, 109001, 5, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 24006, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109002, 6, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 24007, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109002, 7, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 24008, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109002, 8, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 24009, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109002, 9, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 24010, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109002, 10, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", 24011, 0, -385.0, 2, 2.12, "2019/01/31 12:00:00", 24, 109101, 1, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5, 10011, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", 24012, 0, -385.0, 2, 4.19, "2019/01/31 12:00:00", 24, 109101, 2, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 10011, "シズル（バレンタイン）", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", 24013, 0, -385.0, 4, 2.3, "2019/01/31 12:00:00", 24, 109101, 3, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2030/12/17 14:59:59", 24014, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109102, 4, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5, 10011, "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2030/12/17 14:59:59", 24015, 0, -385.0, 2, 5.23, "2019/01/31 12:00:00", 24, 109101, 5, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2030/12/17 14:59:59", 24016, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109102, 6, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", 24017, 0, -385.0, 2, 5.01, "2019/01/31 12:00:00", 24, 109101, 7, 8.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 24018, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109102, 8, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 24019, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109102, 9, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, "シズル（バレンタイン）", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2030/12/17 14:59:59", 24020, 0, 0.0, 1, 0.0, "2019/01/31 12:00:00", 24, 109102, 10, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "2030/12/17 14:59:59", 26001, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 26, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2030/12/17 14:59:59", 26002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 26, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "2030/12/17 14:59:59", 26003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 26, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "2030/12/17 14:59:59", 26004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 26, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, "シェフィ", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "2030/12/17 14:59:59", 27001, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 27, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "2030/12/17 14:59:59", 27002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 27, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "2030/12/17 14:59:59", 27003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 27, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", "2030/12/17 14:59:59", 27004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 27, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", "2030/12/17 14:59:59", 28001, 0, -363.0, 1, 0.0, "2019/09/24 15:00:00", 28, 190801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", "2030/12/17 14:59:59", 28002, 0, -363.0, 1, 0.0, "2019/09/24 15:00:00", 28, 190801, 2, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", "2030/12/17 14:59:59", 29001, 0, -409.0, 1, 0.0, "2019/09/24 15:00:00", 29, 190801, 3, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", "2030/12/17 14:59:59", 29002, 0, -409.0, 1, 0.0, "2019/09/24 15:00:00", 29, 190801, 4, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", "2030/12/17 14:59:59", 30001, 0, -409.0, 1, 0.0, "2019/09/24 15:00:00", 30, 190801, 5, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", "2030/12/17 14:59:59", 30002, 0, -409.0, 1, 0.0, "2019/09/24 15:00:00", 30, 190801, 6, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", "2030/12/17 14:59:59", 31001, 0, -409.0, 1, 0.0, "2019/10/31 12:00:00", 31, 190801, 7, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", "2030/12/17 14:59:59", 31002, 0, -409.0, 1, 0.0, "2019/10/31 12:00:00", 31, 190801, 8, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", "2020/01/04 4:59:59", 32001, 0, -409.0, 1, 0.0, "2019/12/20 5:00:00", 32, 190801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2020/01/04 4:59:59", 32002, 0, -409.0, 1, 0.0, "2019/12/20 5:00:00", 32, 190801, 2, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", "2020/01/04 4:59:59", 33001, 0, -409.0, 1, 0.0, "2019/12/20 5:00:00", 33, 190801, 3, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2020/01/04 4:59:59", 33002, 0, -409.0, 1, 0.0, "2019/12/20 5:00:00", 33, 190801, 4, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", "2020/01/10 11:59:59", 34001, 0, -409.0, 1, 0.0, "2020/01/04 5:00:00", 34, 190801, 5, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", "2020/01/10 11:59:59", 34002, 0, -409.0, 1, 0.0, "2020/01/04 5:00:00", 34, 190801, 6, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", "2030/12/17 14:59:59", 38001, 0, -458.0, 2, 5.3, "2015/12/17 15:00:00", 38, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", "2030/12/17 14:59:59", 38002, 0, -458.0, 2, 6.5, "2015/12/17 15:00:00", 38, 105801, 2, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 0, "ペコリーヌ", "", "2020/04/08 23:59:59", 39005, 0, 9999.0, 3, 0.0, "2020/04/01", 39, 105801, 0, 9999.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "カリン", "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", "2030/12/17 14:59:59", 40001, 0, -430.0, 1, 0.0, "2015/12/17 15:00:00", 40, 190801, 2, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "シェフィ", "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", "2030/12/17 14:59:59", 41001, 2104010, -363.0, 1, 0.0, "2015/12/17 15:00:00", 41, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", "2030/12/17 14:59:59", 41002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 41, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "2030/12/17 14:59:59", 41003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 41, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "2030/12/17 14:59:59", 41004, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 41, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "2030/12/17 14:59:59", 42001, 0, -416.5, 1, 0.0, "2015/12/17 15:00:00", 42, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "シェフィ", "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "2030/12/17 14:59:59", 42002, 2104010, -416.5, 1, 0.0, "2015/12/17 15:00:00", 42, 106401, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "2030/12/17 14:59:59", 42003, 0, -416.5, 1, 0.0, "2015/12/17 15:00:00", 42, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "2030/12/17 14:59:59", 42004, 0, -416.5, 1, 0.0, "2015/12/17 15:00:00", 42, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "ペコリーヌ", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "2030/12/17 14:59:59", 43001, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 43, 105801, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "コッコロ", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "2030/12/17 14:59:59", 43002, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 43, 105901, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "キャル", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2030/12/17 14:59:59", 43003, 0, -363.0, 1, 0.0, "2015/12/17 15:00:00", 43, 106001, 1, 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, "アメス", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2030/12/17 14:59:59", 43004, 0, -416.5, 1, 0.0, "2015/12/17 15:00:00", 44, 123001, 1, 0.0);
